import React, { useEffect, useState, useRef } from 'react';
import styled, { keyframes, css } from 'styled-components';
import { useInView } from 'react-intersection-observer';

// Clean up and organize the logo array
const brandLogos = [
  { src: "/control4.png", alt: "Control4" },
  { src: "/lutron.png", alt: "Lutron" },
  { src: "/sonos.png", alt: "Sonos" },
  { src: "/sony.png", alt: "Sony" },
  { src: "/jvc.png", alt: "JVC" },
  { src: "/leon.png", alt: "Leon" },
  { src: "/senhizer.png", alt: "Sennheiser" },
  { src: "/seura.png", alt: "Seura" },
  { src: "/araknis.png", alt: "Araknis" },
  { src: "/urc.png", alt: "URC" },
  { src: "/smart-clare.png", alt: "Smart Clare" },
  { src: "/oaw.png", alt: "OAW" },
  { src: "/luma.png", alt: "Luma" },
  { src: "/line.png", alt: "Line" }
];

const fadeIn = keyframes`
  from {
    opacity: 0;
    transform: translateY(20px);
  }
  to {
    opacity: 1;
    transform: translateY(0);
  }
`;

const slide = keyframes`
  0% {
    transform: translateX(0);
  }
  100% {
    transform: translateX(-50%);
  }
`;

const LogosSection = styled.section`
  padding: 100px 0;
  background-color: #ffffff;
  position: relative;
  overflow: hidden;
`;

const Container = styled.div`
  max-width: 1300px;
  margin: 0 auto;
  padding: 0 20px;
  position: relative;
  z-index: 1;
`;

const SectionTitle = styled.h2<{ inView: boolean }>`
  font-size: 2.2rem;
  color: var(--secondary);
  margin-bottom: 50px;
  position: relative;
  display: inline-block;
  font-weight: 600;
  text-align: center;
  width: 100%;
  opacity: ${props => props.inView ? 1 : 0};
  transform: translateY(${props => props.inView ? 0 : '20px'});
  transition: all 0.5s ease-out;

  span {
    color: var(--primary);
    position: relative;

    &::after {
      content: '';
      position: absolute;
      bottom: 0;
      left: 0;
      width: 100%;
      height: 8px;
      background-color: rgba(203, 157, 118, 0.15);
      z-index: -1;
    }
  }
`;

const Subtitle = styled.p<{ inView: boolean }>`
  font-size: 1.1rem;
  color: var(--text);
  text-align: center;
  max-width: 700px;
  margin: 0 auto 40px;
  line-height: 1.6;
  opacity: ${props => props.inView ? 1 : 0};
  transform: translateY(${props => props.inView ? 0 : '20px'});
  transition: all 0.5s ease-out;
  transition-delay: 0.1s;
`;

const MarqueeContainer = styled.div<{ inView: boolean }>`
  overflow: hidden;
  position: relative;
  width: 100%;
  opacity: ${props => props.inView ? 1 : 0};
  transition: opacity 0.8s ease-out;

  &::before, &::after {
    content: '';
    position: absolute;
    top: 0;
    width: 100px;
    height: 100%;
    z-index: 2;
  }

  &::before {
    left: 0;
    background: linear-gradient(to right, #ffffff, rgba(255, 255, 255, 0));
  }

  &::after {
    right: 0;
    background: linear-gradient(to left, #ffffff, rgba(255, 255, 255, 0));
  }
`;

const RowContainer = styled.div`
  display: flex;
  margin-bottom: 30px;

  &:last-child {
    margin-bottom: 0;
  }
`;

const MarqueeRow = styled.div<{ isReverse?: boolean }>`
  display: flex;
  animation: ${slide} 40s linear infinite;
  animation-direction: ${props => props.isReverse ? 'reverse' : 'normal'};

  &:hover {
    animation-play-state: paused;
  }
`;

const Logo = styled.div<{ dark?: boolean }>`
  background: ${props => props.dark ? '#1a1a1a' : 'white'};
  padding: 20px;
  margin: 0 20px;
  border-radius: 8px;
  box-shadow: 0 8px 20px rgba(0, 0, 0, ${props => props.dark ? '0.15' : '0.05'});
  transition: all 0.4s ease;
  min-width: 150px;
  height: 100px;
  display: flex;
  justify-content: center;
  align-items: center;
  border: 1px solid ${props => props.dark ? 'rgba(0, 0, 0, 0.2)' : 'rgba(0, 0, 0, 0.05)'};

  &:hover {
    transform: translateY(-5px);
    box-shadow: 0 15px 30px rgba(0, 0, 0, ${props => props.dark ? '0.25' : '0.1'});
    border-color: rgba(203, 157, 118, 0.3);
  }

  img {
    max-width: 85%;
    max-height: 70%;
    object-fit: contain;
    filter: ${props => props.dark ? 'brightness(1.5) contrast(1.1)' : 'none'};
    transition: all 0.3s ease;
  }

  &:hover img {
    transform: scale(1.05);
  }
`;

const BrandRows = [
  brandLogos.slice(0, 7),
  brandLogos.slice(7)
];

const BrandLogos = () => {
  const { ref, inView } = useInView({
    threshold: 0.1,
    triggerOnce: true,
  });

  // Handle image error
  const handleImageError = (e: React.SyntheticEvent<HTMLImageElement, Event>) => {
    const target = e.target as HTMLImageElement;
    target.style.display = 'none';
    target.parentElement!.innerHTML = `<div style="color: var(--primary); font-weight: 500; font-size: 14px; text-align: center;">Brand Logo</div>`;
  };

  // Duplicate logos for smooth infinite scroll
  const duplicateLogos = (logos: typeof brandLogos) => {
    return [...logos, ...logos];
  };

  return (
    <LogosSection ref={ref}>
      <Container>
        <SectionTitle inView={inView}>
          We Partner With <span>Industry Leaders</span>
        </SectionTitle>

        <Subtitle inView={inView}>
          Home Vision Solutions works with the most trusted brands in smart home technology
          to provide you with reliable, cutting-edge solutions.
        </Subtitle>

        <MarqueeContainer inView={inView}>
          {BrandRows.map((row, rowIndex) => (
            <RowContainer key={rowIndex}>
              <MarqueeRow isReverse={rowIndex % 2 === 1}>
                {duplicateLogos(row).map((logo, index) => (
                  <Logo 
                    key={`${logo.alt}-${index}`}
                    dark={true}
                  >
                    <img 
                      src={logo.src} 
                      alt={logo.alt} 
                      onError={handleImageError}
                    />
                  </Logo>
                ))}
              </MarqueeRow>
            </RowContainer>
          ))}
        </MarqueeContainer>
      </Container>
    </LogosSection>
  );
};

export default BrandLogos;
